import React from 'react';
import { useParams } from 'react-router-dom';

const MapPage = () => {
  const { mapName } = useParams();

  return (
    <div>
      <h1>{mapName}</h1>
      <p>This is the map page for {mapName}.</p>
    </div>
  );
};

export default MapPage;
